function getLocalStorage() {
  const localStorageItems = JSON.parse(document.getElementById("vars").value);

  let browserLocalStorage = {};

  for (const item of Object.keys(localStorageItems)) {
    browserLocalStorage[item] = localStorage.getItem(item) || "";
  }

  document.getElementById("browserLocalStorage").value = JSON.stringify(browserLocalStorage);

  document.getElementById("auto-button").click();
}

setTimeout(() => {
  getLocalStorage()
}, "500")

